    for x in file_names:
        file_path = Path.joinpath(local_path, x)
        print(file_path, x)
        file_path.parent.mkdir(parents=True, exist_ok=True)
        print(file_path)
        s3_client.download_file(
            bucket_name,
            dir + x,
            str(file_path)
        )

